}
```
4. Common Subexpression Elimination: Common subexpression elimination is the process of detecting and eliminating common subexpressions in a program. This can result in faster code execution and reduced memory usage.

Example:

Before optimization:
```c
int x = y + z;
int y = x + w;
```
After optimization:
```c
int x = y + z;
int y = x + w;
x = x + w;
```
5. Function Inlining: Function inlining is the process of replacing a function call with the actual code of the function. This can result in faster code execution and reduced memory usage.

